const router = require('express').Router()
const bcrypt = require("bcrypt")
const User = require("../models/User")
    //  upDate a user
router.put('/:id', async(req, res) => {
        if (req.body.userId === req.params.id || req.body.isAdmin) {
            try {
                if (req.body.password) {
                    const salt = await bcrypt.genSalt(10);
                    req.body.password = await bcrypt.hash(req.body.password, salt)
                }

            } catch (error) {
                res.status(403).send(error)
            }
            try {
                const user = await User.findByIdAndUpdate(req.params.id, { $set: req.body })
                res.send(user).status(200)
            } catch (error) {
                res.send(error)
            }


        } else {
            return res.status(401).res.send("you can update this user")

        }
    })
    // Delete a User
router.delete('/:id', async(req, res) => {
    if (req.body.userId === req.params.id) {
        try {
            const user = await User.findByIdAndDelete(req.params.id);
            res.status(200).send("user has been deleted")

        } catch (error) {
            res.send(error)

        }

    } else {
        res.send(" we delete this user")

    }
    // get a user
    router.get('/:id', async(req, res) => {
            if (req.body.userId === req.params.id) {
                try {
                    const user = await User.findById(req.params.id)
                    const { password, ...other } = user._doc
                    res.status(200).json(other)
                } catch (error) {
                    res.send(error)
                }

            } else {
                res.status(403).send('user can not be find')
            }

        })
        // follow a user

    router.put('/:id/follow', async(req, res) => {
        if (req.body.userId !== req.params.id) {
            try {
                const user = await User.findById(req.params.id)
                const currentUser = await User.findById(req.body.userId)
                if (!user.followers.includes(req.body.userId)) {
                    await user.updateOne({ $push: { followers: req.body.useId } })
                    await currentUser.updateOne({ $push: { followings: req.body.useId } })
                } else {

                }
            } catch (error) {

            }
        } else {
            req.send("cant follow yourself")
        }
    })
})

module.exports = router

